import React from "react";
import state from './redux/state';
import classes from "./components/Navigation/Navigation.module.css";



console.log(state);

 export default  function  DropdownLi ({state}){
    const menuDate =  state.navigation.menuData.map(e=>
        <li key={e.id} className={classes.li_dropdoun}>
            <a href={e.url}>{e.label}</a>
        </li>
    );
     return (
             <ul  className={`${classes.ul_dropdoun} ${classes.displayNone}`}>
                 {menuDate}
             </ul>
         )


 };
